import axios from 'axios'
import React, { useEffect, useState } from 'react'
import { Link, Outlet } from 'react-router-dom'

const HomeJ = () => {
  const[myrecipe,setmyrecipe]=useState([])
  useEffect(function(){
    axios.get('http://localhost:1234/Recipes/getAll').then(l=>{setmyrecipe(l.data)})
  },[])
  return  <div>
      {myrecipe?.map(n=><p key={n.id}><Link to={`mymoredetails/${n.id}`}><div className='row'><div className='col-sm-3'><div className='btn btn-default' style={{width:170}}>{n.name}</div>   
      <img class="img-responsive" src={n.pic} width="170" height="145"></img></div></div></Link></p>)}
      <Outlet ></Outlet>
      </div>
    
}

export default HomeJ
